(function(){Vue.component("convos-settings",{props:["error","user"],computed:{show:function(){return this.settings.main.indexOf("#help")==0?"help":this.settings.main.indexOf("#profile")==0?"profile":!this.user.connections.length?"add_connection":this.settings.main.indexOf("#connection")==0?"add_connection":this.settings.main.indexOf("#create-dialog")==0?"create_dialog":"error";}},methods:{fillIn:function(){this.$refs.settings.server=this.settings.default_server||"chat.freenode.net:6697";this.$refs.settings.onConnectCommands="/join #convos";}},template:"<div class=\"convos-settings\">\n    <main v-if=\"show == &#39;error&#39;\">\n      <div class=\"row\">\n        <div class=\"col s12\">\n          <h4>{{error.title || &quot;Not found&quot;}}</h4>\n          <p>{{error.message}}</p>\n        </div>\n      </div>\n    </main>\n    <main v-if=\"show == &#39;add_connection&#39;\">\n      <convos-connection-settings :user=\"user\"></convos-connection-settings>\n    </main>\n    <main v-if=\"show == &#39;create_dialog&#39;\">\n      <convos-create-dialog :user=\"user\"></convos-create-dialog>\n    </main>\n    <main v-if=\"show == &#39;help&#39;\">\n      <convos-help :user=\"user\"></convos-help>\n    </main>\n    <main v-if=\"show == &#39;profile&#39;\">\n      <convos-profile :user=\"user\"></convos-profile>\n    </main>\n  </div>\n"})})();